    return (
        <div style={{ width: isCollapsed ? '50px' : '500px', backgroundColor: '#f0f0f0' }}>
            <button onClick={handleCollapse}>
                {isCollapsed ? 'Expandir' : 'Colapsar'}
            </button>
            {/* Agrega aquí más contenido para la columna izquierda */}
        </div>
    );
};

